import React from 'react';
import './projects.css';

class Projects extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            image: require('./images/overdue.png'),
            name: "Overdue",
            about: "Counting your monthly expenses",
        }
    };

    render() {
        return (
            <div className="App">

                <div style={{ left: 0, backgroundColor: '#fff'}} className="split">
                    <img src={this.state.image} className="mockupImg"></img>
                </div>

                <div style={{ right: 0, backgroundColor: '#0000' }} className="split">
                    <h1 className="title">{this.state.name}</h1>
                    <p className="about">{this.state.about}</p>
                </div>

                <div style={{ width: 60, height: 60, color: '#c0c0c0', borderRadius: 30 }}>

                </div>

            </div>
            );
    }

}

export default Projects;
